const FORM_ENDPOINT = "https://public.herotofu.com/v1/20afd840-d86e-11ec-9d7b-556d531b7d73"; // TODO - fill on the later step

const ContactForm = () => {
  const [submitted, setSubmitted] = useState(false);
  const handleSubmit = () => {
    setTimeout(() => {
      setSubmitted(true);
    }, 100);
  };

  if (submitted) {
    return (
      <>
        <div className="PosC">Thank you!</div>
        <div className="PosC">We'll be in touch soon.</div>
      </>
    );
  }

  return (
<main>
        <form action="https://public.herotofu.com/v1/20afd840-d86e-11ec-9d7b-556d531b7d73" method="post">
    <div>
    <label for="name">Your Name</label>
    <input name="Name" id="name" type="text" required />
  </div>
  <div>
      <label for="telefone">Seu telefone</label>
      <input type="text" id="telefone" name="telefone" required />
  </div>
  <div>
    <label for="email">Your Email</label>
    <input name="Email" id="email" type="email" required  />
  </div>
  <div>
    <input type="submit" value="Download CTA" />
  </div>
</form>
    </main>
  );
};

export default ContactForm;
